Берг Александр.   19.

На основании полученных в ходе исследования результатов можно дать следующее заключение.

Предприимчив, решителен, энергичен, знает чего хочет и умеет добиваться поставленных целей. Может быть непоследователен. Имеет широкий круг контактов, отзывчив и участлив. Высокие оценки по фактору «уравновешенность» свидетельствуют об отсутствии внутренней напряженности, свободе от конфликтов, удовлетворенности собой и своими успехами, готовности следовать нормам и требованиям.
Честолюбив. Может повести за собой. Экстраверт. Эмоционально зрел. Реалист.

