Параметры креативности:

Продуктивность (беглость) – этот фактор характеризует беглость творческого мышления, и определяется общим числом ответов.
Гибкость – характеризует гибкость творческого мышления и способность к быстрому переключению. Этот показатель оценивает разнообразие идей и стратегий, способность переходить от одного аспекта к другому.
Оригинальность – характеризует оригинальность и своеобразие творческого мышления, необычность подхода к проблеме. Этот показатель характеризует способность выдвигать идеи, отличающиеся от очевидных, общеизвестных, общепринятых, банальных или твердо установленных. Тот, кто получает высокие значения этого показателя, обычно характеризуются высокой интеллектуальной активностью и неконформностью. Оригинальность решений предполагает способность избегать легких, очевидных и неинтересных ответов.
Разработанность – Высокие значения этого показателя характерны для учащихся с высокой успеваемостью, способных к изобретательской и конструктивной деятельности. Показатель разработанности ответов отражает как бы другой тип беглости мышления и в определенных ситуациях может быть как преимуществом, так и ограничением, в зависимости от того, как это качество проявляется.

ПРОЦЕНТРАНГ оценивает положение результата тестирования среди ВСЕХ результатов тестирования, (больше цифра – выше результат, относительно остальных).
